import { useState } from "react";
import { useNavigate, useOutletContext } from "react-router-dom";

const EditMovie = () => {
  const navigate = useNavigate();
  const { jwtToken } = useOutletContext();

  const [error, setError] = useState(null);

  return (
    <div>
      <h2>Edit a movie</h2>
      <hr />
    </div>
  );
};

export default EditMovie;
